import React from 'react'
import { useLocation, Navigate } from 'react-router-dom'

const Calendar = () => {
    const auth = false;

    if (!auth) {
        return <Navigate to="/login" />
    }

    return (
        <div>Привет</div>
    )
}

export default Calendar
